Widgetarium lets you add stylish widgets directly onto your home screen! Choose from premade widget designs, or better yet, make your own. Widgetarium is perfect for customizing and styling your home screen.

Ordinary and Standart widget apps don't meet the requirements of modern life anymore. Please welcome — the A-Widgetarium.
A-Widgetarium - the best and only way to customize your home screen. Finally, everything you ever wanted in one app. Your phone is your life, your work, your best friend - arrange it the way it fits you and your lifestyle.

A-Widgetarium's features:
- custom-made icons;
- everyday quotations and advice;
- more than 20 options of watches;
- weather forecast and horoscopes;
- notepads and the ability to save your ideas;
- reminders, calendars, and alarms;
- to-do-lists and your personal planner;
- customize the quotes' design;
- all sorts of converters: currency, timezone, temperature. 

Choose your side by setting widget theme dark or light. Let A-Widgetarium make your life easier!

Widgetarium works on all iOS/iPadOS devices, with the only requirement being running iOS 14 and higher.   


